import React, { useEffect, useState } from "react";
import { scroller } from "react-scroll";
import backgroundImage from '../assets/background.jpg'; // 导入背景图片
import seraImage from '../assets/SERA-Platform.png';
import algorithmIntro from '../assets/Technology-page-image.png'
import NavBar from "./NavBar";
import ArrowDownwardIcon from '@mui/icons-material/ArrowDownward';
import { IconButton } from '@mui/material';

function Dashboard() {
  const [isVisible, setIsVisible] = useState(false);
  const [navBarHeight, setNavBarHeight] = useState(100);

  useEffect(() => {
    setIsVisible(true);

    const handleScroll = () => {
      const scrollTop = window.pageYOffset || document.documentElement.scrollTop;
      if (scrollTop > 50) {
        setNavBarHeight(60);
      } else {
        setNavBarHeight(100);
      }
    };

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  const dashboardStyle = {
    display: 'flex',
    width: '100vw',
    height: '100vh',
    alignItems: 'center',
    justifyContent: 'center',
    position: 'relative',
    transition: 'opacity 1s ease-in-out',
    opacity: isVisible ? 1 : 0,
  };

  const backgroundStyle = {
    content: '""',
    position: 'fixed', // 固定背景
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
    backgroundColor: '#4f2479',
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    opacity: 0.6, // 设置背景图片的透明度
    zIndex: -1, // 确保背景图片在内容后面
    backgroundBlendMode: 'multiply',
  };

  const textContainerStyle = {
    position: 'absolute',
    width: '80vw',
    top: '50%', // 调整top值向上移动
    left: '50%',
    transform: 'translate(-50%, -50%)',
    textAlign: 'center',
    color: 'black',
    zIndex: 1, // 确保文本在背景图片前面
  };

  const titleStyle1 = {
    fontSize: '42px',
    fontWeight: 'bold',
    width: 'auto',
    marginBottom:'40px',
    color: 'white',
  };

  const paragraphStyle1 = {
    maxWidth: '80vw', // 设置最大宽度而不是宽度的百分比
    fontSize: '24px',
    marginTop: '20px',
    fontWeight: 'bold',
    lineHeight: '1.4',
    color: 'white',
  };

  const titleStyle = {
    color: '#3c2e5f',
    fontSize: '42px',
    fontWeight: 'bold',
    width: 'auto',
    marginBottom:'40px',
  };

  const paragraphStyle = {
    color: '#3c2e5f',
    maxWidth: '80vw', // 设置最大宽度而不是宽度的百分比
    fontSize: '24px',
    marginTop: '20px',
    fontWeight: 'bold',
    lineHeight: '1.4',
  };

  const whiteSectionStyle = {
    ...dashboardStyle,
    backgroundColor: 'white',
    color: 'black',
  };

  const arrowButtonStyle = {
    position: 'absolute',
    bottom: '80px',
    left: '50%',
    transform: 'translateX(-50%)',
    zIndex: 1,
  };

  const handleArrowClickToSection2 = () => {
    scroller.scrollTo('section2', {
      duration: 1500, // 设置滚动持续时间为1.5秒
      delay: 0,
      smooth: 'easeInOutQuart',
    });
  };

  const handleArrowClickToSection3 = () => {
    scroller.scrollTo('section3', {
      duration: 1500, // 设置滚动持续时间为1.5秒
      delay: 0,
      smooth: 'easeInOutQuart',
    });
  };

  return (
    <>
      <NavBar navBarHeight={navBarHeight} />
      <div style={backgroundStyle}></div>
      <div className="section" id="section1" style={dashboardStyle}>
        <div style={textContainerStyle}>
          <div style={titleStyle1}>Welcome to ProteoInsight</div>
          <div style={paragraphStyle1}>
            An advanced platform focused on protein analysis. We use the latest PIWAS and PIE algorithms to provide you with comprehensive and accurate proteomics data analysis and insights. Whether you are a researcher, bioinformatics expert, or a professional engaged in biomedical research, ProteoInsight will be your right-hand assistant for protein research and analysis.
          </div>
        </div>
        <IconButton sx={{color: 'white'}} onClick={handleArrowClickToSection2} style={arrowButtonStyle}>
          <ArrowDownwardIcon fontSize="large" />
        </IconButton>
      </div>
      <div className="section" id="section2" style={whiteSectionStyle}>
        <div style={textContainerStyle}>
          <div style={titleStyle}>About input data</div>
          <div style={paragraphStyle}>
            The input data is come from Serum Epitope Repertoire Analysis (SERA) Platform. Combining universal chemistry with proprietary informatics, SERA assesses antibody repertoires to address research and clinical needs. For more information, visit <a href="https://serimmune.com/technology/#sera" target="_blank" rel="noopener noreferrer">Serimmune</a> website.
          </div>
          <img src={seraImage} style={{ height: '30vh', marginTop: '40px' }} alt="SERA-Platform" />
        </div>
        <IconButton onClick={handleArrowClickToSection3} style={arrowButtonStyle}>
          <ArrowDownwardIcon fontSize="large" />
        </IconButton>
      </div>
      <div className="section" id="section3" style={whiteSectionStyle}>
        <div style={textContainerStyle}>
          <div style={titleStyle}>Two Bioinformatics Methods</div>
          <div style={paragraphStyle}>
          <b>PIWAS (Protein-based Immunome Wide Association Study )</b> is an algorithm used to identify epitopes associated with disease. It analyzes protein interactions to estimate the significance of these interactions and provides insights into biological processes and disease mechanisms.
          <br /><br />  
          <b>PIE (Protein-wide Identification of Epitopes)</b> is a complementary algorithm used to identify motifs associated with disease.  It involves identifying epitopes, which are specific parts of antigens that are recognized by the immune system, particularly by antibodies, B cells, or T cells. 
          </div>
          <img src={algorithmIntro} style={{ height: '30vh', marginTop: '40px' }} alt="algorithm_info" />
        </div>
      </div>
    </>
  );
}

export default Dashboard;
